import React, { useState, useEffect } from 'react';
import Facade from './ApiFacade'

export default function LoggedIn() {
  const [username, setUsername] = useState();
  const [balance, setBalance] = useState();
  const [role, setRole] = useState();

  useEffect(() => {
    Facade.fetchUser().then(res => { setUsername(res.userName); setBalance(res.balance); setRole(res.roleList) }).catch(e => console.log(e));
  }, [])

  return (
    <div class="row no-gutters">
      <div class="col-6 col-md-2 logged-in-left-menu logged-in-col">
        <div className="row"><p>hey</p></div>
        <div className="row"></div>
        <div className="row">
          <h2>Data Received from server</h2>
          <h3>Balance: {balance}</h3>
          <h3>Username: {username}</h3>
          <h3>Role: {role}</h3>
        </div>
      </div>

      <div class="col-12 col-sm-6 col-md-8 logged-in-right-menu logged-in-col">.col-12 .col-sm-6 .col-md-8</div>

    </div>
  )
}
